// Choice.js
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import YourComponent from './YourComponent';

function Choice() {
    const [choice, setChoice] = useState(null);
    const [events, setEvents] = useState([]);

    const elelist = [
        <YourComponent events={events} setEvents={setEvents} />,
        <div>HomeHire Component</div> // Assuming you have a HomeHire component
    ];

    return (
        <div>
            <Link to="/hireform" className="btn btn-dark" onClick={() => setChoice(0)}>We Need Volunteers</Link>
            <Link to="/volunteer" className="btn btn-dark" onClick={() => setChoice(1)}>I Will Volunteer</Link>
            {elelist[choice]}
        </div>
    );
}

export default Choice;
